function Product({ items }) {
  return (
    <div>
      <img
        key={items.id}
        className="medium"
        src={items.images}
        alt={items.item_name}
      />
      <h4>{items.item_name}</h4>
      <div>${items.price}</div>
      <div>
        <button>add to cart</button>
      </div>
    </div>
  );
}
export default Product;
